import React, { useState } from 'react';
import { Eye, EyeOff } from 'lucide-react';
import './FreelanceAuthPages.css';
import Box from '@mui/material/Box';
import Modal from '@mui/material/Modal';
import { useNavigate } from 'react-router-dom';

const LoginPage = () => {
  const [showPassword, setShowPassword] = useState(false);
  const [displaymodal, setDisplaymodal] = useState(false);
  const [formData, setFormData] = useState({ email: '', password: '' });
  const [errors, setErrors] = useState({});
  const navigate = useNavigate();

  const validateForm = () => {
    const newErrors = {};
    const emailPattern = /^[a-zA-Z0-9]+@gmail\.com$/;
    if (!formData.email) newErrors.email = 'Email is required';
    else if (!emailPattern.test(formData.email)) newErrors.email = 'Use format like abc123@gmail.com';
    if (!formData.password) newErrors.password = 'Password is required';
    else if (formData.password.length < 8) newErrors.password = 'Minimum 8 characters required';

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = async () => {
    if (!validateForm()) return;

    try {
      const res = await fetch('http://localhost:8081/api/auth/login', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(formData),
      });

      const data = await res.text();
      if (res.ok) {
        // Store authentication state
        localStorage.setItem('isAuthenticated', 'true');
        localStorage.setItem('userEmail', formData.email);

        // ✅ NEW: fetch user ID by email and store it
        const userRes = await fetch(`http://localhost:8081/api/auth/email/${formData.email}`);  // ✅
        const userData = await userRes.json();                                                  // ✅
        localStorage.setItem('userId', userData.id);                                            // ✅

        setDisplaymodal(true);
      } else {
        alert(data || 'Something went wrong!');
      }
    } catch (err) {
      alert('Server not reachable.');
      console.error(err);
    }
  };

  const handleModalClose = () => {
    setDisplaymodal(false);
    navigate('/'); 
  };

  const style = {
    position: 'absolute', top: '50%', left: '50%', transform: 'translate(-50%, -50%)',
    width: 350, bgcolor: 'rgb(255, 255, 255)', backdropFilter: 'blur(12px)',
    WebkitBackdropFilter: 'blur(12px)', border: '1px solid rgba(255, 255, 255, 0.3)',
    borderRadius: '16px', boxShadow: '0 8px 32px rgba(31, 38, 135, 0.37)', p: 4,
    textAlign: 'center', color: '#0d47a1',
  };

  const buttonStyle = {
    marginTop: '20px', padding: '10px 20px', background: '#00c6ff', color: 'white',
    border: 'none', borderRadius: '8px', cursor: 'pointer', fontWeight: 'bold',
    fontSize: '14px', boxShadow: '0 4px 12px rgba(0,0,0,0.15)', transition: 'background 0.3s ease',
  };

  return (
    <div className="container">
      <div className="grid">
        <div className="branding">
          <h1>SkillsFusion</h1>
          <p>Connect. Create. Collaborate.</p>
        </div>

        <div className="card">
          <h2>Welcome Back</h2>
          <p>Sign in to your account</p>
          <div className="input-field">
            <label>Email</label>
            <input 
              name="email" 
              type="email" 
              value={formData.email} 
              onChange={e => setFormData({ ...formData, email: e.target.value })} 
              placeholder="abc123@gmail.com" 
              className={errors.email ? 'error' : ''} 
            />
            {errors.email && <p className="error-message">{errors.email}</p>}

            <label>Password</label>
            <div className="password-field">
              <input 
                name="password" 
                type={showPassword ? 'text' : 'password'} 
                value={formData.password} 
                onChange={e => setFormData({ ...formData, password: e.target.value })} 
                placeholder="Enter password" 
                className={errors.password ? 'error' : ''} 
              />
              <button type="button" onClick={() => setShowPassword(!showPassword)}>
                {showPassword ? <EyeOff size={18} /> : <Eye size={18} />}
              </button>
            </div>
            {errors.password && <p className="error-message">{errors.password}</p>}

            <div className="button" onClick={handleSubmit}>Sign In</div>
            <div className="toggle-mode">
              <p>
                Don't have an account?
                <button
                  onClick={() => navigate('/signup')}
                  style={{
                    background: 'none',
                    border: 'none',
                    color: '#00c6ff',
                    fontWeight: 'bold',
                    cursor: 'pointer',
                    marginLeft: '5px',
                  }}
                >
                  Sign up
                </button>
              </p>
            </div>
          </div>
        </div>
      </div>

      <Modal open={displaymodal} onClose={handleModalClose}>
        <Box sx={style}>
          <h2 style={{ color: '#00c6ff', fontWeight: 'bold' }}>Login Success</h2>
          <p style={{ margin: '10px 0', color: '#333' }}>Welcome back! You've successfully logged in.</p>
          <button
            onClick={handleModalClose}
            style={buttonStyle}
            onMouseOver={e => (e.target.style.background = '#0095c5')}
            onMouseOut={e => (e.target.style.background = '#00c6ff')}
          >
            Continue
          </button>
        </Box>
      </Modal>
    </div>
  );
};

export default LoginPage;
